/*Write a C program to find the quotient and remainder of a division. */
#include<stdio.h>
void main()
{
  int a,b,c,d;
  scanf("%d%d",&a,&b);
  c=a/b;
  d=a%b;
  printf("%d %d",c,d);
}

/*Write a C++ program to find the quotient and remainder of a division. */
#include <iostream>
using namespace std;
int main()
{
    int a,b,c,d;
    cin >> a >> b;
    c=a/b;
    d=a%b;
    cout << c << " " << d;
}

/*Write a Java program to find the quotient and remainder of a division.*/
public class Funycode {
      int a,b,c,d;
      Scanner sc=new Scanner(System.in);
      a=sc.nextInt();
      b=sc.nextInt();

      c=a/b;
      d=a%b;
      System.out.println(c + " " + d);
}

